@andyman aus What I was getting at was that Amber knowingly made false statements under oath and got caught doing so in real time. No investigation was required as it happened in session, ie, right in front of the judge, more than once. She also tried to get witnesses to lie for her and they are on record as saying so. I think this might qualify as attempting to pervert the course of justice, but I'm no lawyer. 
Besides- Amber wasn't the defendant, it's just that she told lies, that were then printed by a paper. To win, Johnny had to prove that the libel (by The Sun newspaper) had actually done him some harm or damage.
 Strangely enough, if he brought the case to court now (post career collapse) he would probably stand a better chance of proving that he'd been harmed.

@Carlos Tommy Baggs The British court system is not an investigative body.  That means they cannot (are prohibited from) performing their own investigations outside the court.  Even a Google search falls outside the courts' jurisdiction.  They can certainly order others to make investigations but this was a civil case and it was up to each party to make their own investigations and present them to the court.

As far as pretty girls getting away with stuff such as perjury and much worse, with little more than the bat of an eye, you are completely correct in your suspicion.  The bias is unfortunately all too common and is borne out by the stunning differences in conviction rates and sentences for equivalent crimes. 

This is what concerns me most, that a court will find AH guilty beyond any doubt but will give her no more than a stern talking to and a slap on the wrist.  This is also why she must be shunned and her movies boycotted, because that is the only justice we can be sure of.

@kazoosc and yes things always go slow as they want to cross all the T's and dot all their I's so when they take any action there is wiggle room.

Also so they can get all the offences in the row.

Statements are one thing, statements or evidence used in court is another thing.

@Wilma Perkins Barnaby Joyce is an Australian politician who was involved with the infamous quarantine breach.  He was very vocal about the very real risk that the dogs may have brought diseases into Australia.  

I live only a few kilometres from Warner Studios where they filmed Aquaman and near where the nameless one stayed with her dogs who, according to reports, were let outside unrestrained to do their business.  This action put my own dogs and the dogs of every other person on the Gold Coast at immediate risk from potential exotic diseases transferred from her dogs' faeces to birds and other scavengers to our pets.

The nameless one still doesn't get the seriousness of her offences but if she hits Aussie soil again it's going to be a big wake up call for her.
